import React from "react";
import {
  EuiFieldText,
  EuiFormRow,
  EuiDualRange,
  EuiSwitch,
  EuiForm,
  EuiSpacer,
  EuiDatePickerRange,
  EuiDatePicker,
} from "@elastic/eui";
import "@elastic/eui/dist/eui_theme_light.css";
import { htmlIdGenerator } from "@elastic/eui/lib/services";

const SidePanel = (props) => {
  return (
    <EuiForm component="form">
      <EuiFormRow label="Discount Range">
        <EuiDualRange
          id={htmlIdGenerator()()}
          value={props.dualValue}
          onChange={props.onRangeChange}
          showInput
          showRange
          minInputProps={{ "aria-label": "Min value" }}
          maxInputProps={{ "aria-label": "Max value" }}
          aria-label="Discount-range"
        />
      </EuiFormRow>
      <EuiSpacer />
      <EuiFormRow label="Brand">
        <EuiFieldText name="brand-name" />
      </EuiFormRow>
      <EuiSpacer />
      <EuiFormRow label="Availability" hasChildLabel={false}>
        <EuiSwitch
          id={htmlIdGenerator()()}
          label="In Stock"
          name="switch"
          checked={props.isSwitchChecked}
          onChange={props.onSwitchChange}
        />
      </EuiFormRow>
      <EuiSpacer />
      <EuiFormRow label="Creation Date">
        <EuiDatePickerRange
          startDateControl={
            <EuiDatePicker
              selected={this.state.startDate}
              onChange={this.handleChangeStart}
              startDate={this.state.startDate}
              endDate={this.state.endDate}
              isInvalid={this.state.startDate > this.state.endDate}
              aria-label="Start date"
            />
          }
          endDateControl={
            <EuiDatePicker
              selected={this.state.endDate}
              onChange={this.handleChangeEnd}
              startDate={this.state.startDate}
              endDate={this.state.endDate}
              isInvalid={this.state.startDate > this.state.endDate}
              aria-label="End date"
            />
          }
        />
      </EuiFormRow>
    </EuiForm>
  );
};

export default SidePanel;
